import React, { useState, useEffect } from 'react';
import './TrackList.css';
import Track from '../Track/Track';

function TrackList({ searchResults }, props) {

    const [toPlaylist, setToPlaylist] = useState([]);
    useEffect(() => {
        console.log(toPlaylist);
    })

    const onAdd = (tr) => {
        setToPlaylist(prev => [{ tr }, ...prev])    
    }

    return (
        <div className="TrackList">
            {searchResults.map(
                searchResultObject => <Track searchResultObject={searchResultObject} onAdd={tr => onAdd(tr)} />)}
        </div>
    )
}

export default TrackList;
